import { getAll } from "../../utils/auth";
const LoginReducer = (state = { loginInfo: getAll() }, action) => {
  switch (action.type) {
    case "LOGIN_INFO":
      return {
        loginInfo: JSON.parse(state.loginInfo),
      };

    default:
      return state;
  }
};

export default LoginReducer;
